  03> WILLIAMS, Maude Mary Anne m on 15.09.1909 to BURGE, George Arthur
  b 18.05.1865 d 20.05.1957
  b ** ** 1871 d ** **, 1962
  Maude b. at Hutt. No children. Maude and George both d. at Masterton, Maude and George were both talented
  artists, Maude having studied painting under Goldie. They lived in France for a time and Frances Hodgkins
  stayed with them at their home in St Tropez in 1931. A painting by Maude entitled 'The Pig Market, Montreuil'
  hangs in the National Art Gallery in Wellington. In recent years some of her paintings have sold for as much as
  $25,000.
  Eventually Maude and George settled in Taupo before moving to Masterton where, after George's death, Maude
  spent her final years.
  in Christer Henry Sety, LOCAfter He
  04> WILLIAMS, Hilda Temple
  b 03.04.1867 d 19.12.1939
  Hilda b. at Hutt and d. at Christchurch. She spent most of her life in Christchurch, and was an accomplished
  painter. In the 1930's Hilda became interested in the life of her grandfather, Henry Williams. With the help of
  her cousin, Henry (Hal) Williams, she researched from the Church Missionary Society, London letters and
  manuscripts appropriate to the early activities of the Rev Henry Williams in New Zealand. After her death her
  work was continued by Algar Temple Williams (qv).
  05> WILLIAMS, Guy Coldham m on 12.12.1905 to HOPE-LEWIS, Eileen
  b 18.08.1868 d 08.04.1947
  b 16.10.1884 d 15.10.1958
  Guy b. at Hutt and educated at Christ's College. Guy and Eileen lived at "Te Parae", Masterton. Eileen was an
  accomplished golfer She won the New Zealand Ladies' Golf Championship six times. She also won the provincial
  championships in Taranaki, Wairarapa, Rotorua, Manawatu and Wellington and she won the Australian Championship
  in 1920. While overseas she reached the semi-finals in both Great Britain and France.
